import React from "react";
import {
	MenuContainer,
	MenuWrap,
	MenuItens,
	MenuTitulo,
	MenuLista,
	MenuListaItem,
} from "./MenuElementos";

import LineStyleIcon from "@material-ui/icons/LineStyle";

const Menu = () => {
	return (
		<MenuContainer>
			<MenuWrap>
				<MenuItens>
					<MenuTitulo>Painel</MenuTitulo>
					<MenuLista>
						<MenuListaItem>
							<LineStyleIcon />
						</MenuListaItem>
					</MenuLista>
				</MenuItens>
			</MenuWrap>
		</MenuContainer>
	);
};

export default Menu;
